import React from "react";

const Profile = () => (
  <div className="p-8">
    <h2 className="text-2xl font-bold mb-4">Profile & Progress</h2>
    <div className="bg-white p-4 rounded shadow">
      <h3 className="font-semibold">Your Profile</h3>
      <p>View your progress, badges, streaks, and account details here.</p>
    </div>
  </div>
);

export default Profile;
